description:
The Marvels Project is a modern day retelling of the origin story of the Marvel Universe.  Taking place between 1938 and 1942, the comic centers on the unknown connections between Marvel's biggest Golden Age heroes and how their creation still impacts Marvels characters today. 

Written by Ed Brubaker with art by Steve Epting


